import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar(){
  return (
<>
    <nav className="navbar">
    <div className="navbar-container">
    <Link to ="/" className="navBar-logo">CivicFix</Link> 
 </div>
</nav>
</> )
}
